rust-new-project-template All Rust projects can follow this pattern: Create a new repo using Rust New Project Template: https://github.com/noahgift/rust-new-project-template Create a new Codespaces and use it Use main.rs to call handle CLI and use lib.rs to handle logic and import clap in Cargo.toml as shown in this project. Use `cargo init --name 'hello' or whatever you want to call your project. Put your "ideas" in as comments in rust to seed GitHub Copilot, i.e //build add function Run make format i.e. cargo format Run make lint i.e. cargo clippy --quiet Run project: cargo run -- --help Push your changes to allow GitHub Actions to: format check, lint check, and other actions like binary deploy. This pattern is a new emerging pattern and is ideal for systems programming in Rust. 1 1-prompt-engineering Repo example here: https://github.com/nogibjj/hello-rust Reproduce A good starting point for a new Rust project To run: cargo run -- marco --name "Marco" Be careful to use the NAME of the project in the Cargo.toml to call lib.rs as in: [package]
name = "hello" For example, see the name hello is invoked alongside marco_polo which is in lib.rs. lib.rs code: /* A Marco Polo game. */ /* Accepts a string with a name.
If the name is "Marco", returns "Polo".
If the name is "any other value", it returns "Marco".
*/
pub fn marco_polo(name: &str) -> String { if name == "Marco" { "Polo".to_string() } else { "Marco".to_string() }
} main.rs code: fn main() { let args = Cli::parse(); match args.command { Some(Commands::Marco { name }) => { println!("{}", hello::marco_polo(&name)); } None => println!("No command was used"), }
} Other References Cargo Book The Rust Programming Language Official Tutorial Comprehensive Rust Google Tutorial rust-cli-template Command-Line Rust
